import React from 'react';
/** Import components */
import {
  Navbar,
  NavbarBrand,
} from 'reactstrap';

/** Import assets */
import logo from 'assets/images/logo.jpg';
import './topNav.css';

class TopNav extends React.Component {
  handleLogoutClick(e) {
    this.props.authActions.logout();
  }
  render() {
    // const { name } = this.props.currentUser;
    return (
      <div className="top-nav">
        <Navbar light expand className="shadow-sm bg-white p-0 h-100">
          <NavbarBrand href="/">
            <img src={logo} alt="ChatMatic" className="top-nav-logo" />
          </NavbarBrand>
          <NavbarBrand href = "/home">
             <i className = "fa fa-home"></i>Home
          </NavbarBrand>
          <NavbarBrand href = "/exercise">
             <i className = "fa fa-home"></i> Exercise
          </NavbarBrand>
          <NavbarBrand href = "/food">
             <i className = "fa fa-home"></i> Food
          </NavbarBrand>
          <NavbarBrand href = "/supplements">
             <i className = "fa fa-home"></i> Supplements
          </NavbarBrand>
        </Navbar>
      </div>
    );
  }
}

export default TopNav
